import { useDispatch} from "react-redux";
import { getPokemonType } from "../Store/action";

export default function MyTeam() {
  const store= useDispatch()
  
  
  const types =  store(getPokemonType)
  return (
  <>
  
   <di>
    <ul>
      {
        types.map(e=>{
          return
          <li>{e.name}</li>
        })
      }
    </ul>
   </di>
  </>

  )
}
